/**
 * refresh_sccpOmMIB: refresh sccpOmMIB scalars
 *
 * Normally, the values retrieved from the operating system are cached.
 * When the agent receives a SIGPOLL from an open STREAMS configuration
 * or administrative driver Stream, the STREAMS subsystem indicates to
 * the agent that the cache has been invalidated and that it should
 * reread scalars and tables from the STREAMS susbystem.  This function
 * is used when the agent starts for the first time, or after a SIGPOLL
 * has been received (and a scalar has been requested).
 */
void
refresh_sccpOmMIB(void)
{
	if (sccpOmMIBStorage == NULL) {
		if ((sccpOmMIBStorage = SNMP_MALLOC_STRUCT(sccpOmMIB_data)) == NULL)
			return;

		/* Update scalar defaults as required here... */

		sccpOmMIB_refresh = 1;
	}

	if (sccpOmMIB_refresh == 0)
		return;
	sccpOmMIB_refresh = 0;

	/* Update scalars as required here... */

}

/*
 * var_sccpOmMIB():
 *   This function is called every time the agent gets a request for
 *   a scalar variable that might be found within your mib section
 *   registered above.  It is up to you to do the right thing and
 *   return the correct value.
 *     You should also correct the value of "var_len" if necessary.
 *
 *   Please see the documentation for more information about writing
 *   module extensions, and check out the examples in the examples
 *   and mibII directories.
 */
u_char *
var_sccpOmMIB(struct variable *vp, oid * name, size_t *length, int exact, size_t *var_len, WriteMethod ** write_method)
{
	struct sccpOmMIB_data *StorageTmp;

	if (header_generic(vp, name, length, exact, var_len, write_method)
	    == MATCH_FAILED)
		return NULL;

	/* Refresh the MIB values if required. */
	refresh_sccpOmMIB();

	if ((StorageTmp = sccpOmMIBStorage) == NULL)
		return NULL;

	/* This is where we do the value assignments for the mib results. */

	switch (vp->magic) {

	case SCCPOM1STANDINTERVALACTIVATE:
		*write_method = write_sccpOm1stAndIntervalActivate;
		*var_len = StorageTmp->sccpOm1stAndIntervalActivateLen;
		return (u_char *) StorageTmp->sccpOm1stAndIntervalActivate;

	case SCCPOM1STANDINTERVALDEACTIVATE:
		*write_method = write_sccpOm1stAndIntervalDeactivate;
		*var_len = StorageTmp->sccpOm1stAndIntervalDeactivateLen;
		return (u_char *) StorageTmp->sccpOm1stAndIntervalDeactivate;

	case SCCPOM5MINACTIVATE:
		*write_method = write_sccpOm5MinActivate;
		*var_len = StorageTmp->sccpOm5MinActivateLen;
		return (u_char *) StorageTmp->sccpOm5MinActivate;

	case SCCPOM5MINDEAACTIVATE:
		*write_method = write_sccpOm5MinDeaActivate;
		*var_len = StorageTmp->sccpOm5MinDeaActivateLen;
		return (u_char *) StorageTmp->sccpOm5MinDeaActivate;

	case SCCPOM15MINACTIVATE:
		*write_method = write_sccpOm15MinActivate;
		*var_len = StorageTmp->sccpOm15MinActivateLen;
		return (u_char *) StorageTmp->sccpOm15MinActivate;

	case SCCPOM15MINDEAACTIVATE:
		*write_method = write_sccpOm15MinDeaActivate;
		*var_len = StorageTmp->sccpOm15MinDeaActivateLen;
		return (u_char *) StorageTmp->sccpOm15MinDeaActivate;

	case SCCPOMDISCONTINUITYTIME:
		*write_method = NULL;	/* read-only */
		*var_len = sizeof(StorageTmp->sccpOmDiscontinuityTime);
		return (u_char *) &StorageTmp->sccpOmDiscontinuityTime;

	case SCCPOMTIMESTAMP:
		*write_method = NULL;	/* read-only */
		*var_len = sizeof(StorageTmp->sccpOmTimeStamp);
		return (u_char *) &StorageTmp->sccpOmTimeStamp;

	case SCCPOM5MINMAXINTERVALS:
		*write_method = write_sccpOm5MinMaxIntervals;
		*var_len = sizeof(StorageTmp->sccpOm5MinMaxIntervals);
		return (u_char *) &StorageTmp->sccpOm5MinMaxIntervals;

	case SCCPOM15MINMAXINTERVALS:
		*write_method = write_sccpOm15MinMaxIntervals;
		*var_len = sizeof(StorageTmp->sccpOm15MinMaxIntervals);
		return (u_char *) &StorageTmp->sccpOm15MinMaxIntervals;

	default:
		ERROR_MSG("");
	}
	return NULL;
}

