/**
 * rotate_sccpOmErrorsTable(): rotate sccpOmErrorsTable
 *
 * Every 5 minutes we need to rotate current data into the 5-minute historical data table and every
 * 15 minutes (every 3rd 5-minute interval), we need to rotate current data into the 15-minute
 * historical data table.
 */
void
rotate_sccpOmErrorsTable(void)
{
	struct header_complex_index *hci, *hci5, *hci15;
	struct sccpOmErrorsTable_data *curr;
	bool need5 = false, need15 = false;

	for (hci = sccpOmErrorsTableStorage; hci; hci = hci->next) {
		curr = (typeof(curr)) hci->data;
		/* Allocate a new interval if we don't already have the maximum number of stored
		 * intervals */
		if (curr->sccpOmErrors5MinValidIntervals < sccpOmMIBStorage->sccpOm5MinMaxIntervals) {
			struct sccpOm5MinHistoryTable_data *StorageTmp;

			if ((StorageTmp = SNMP_MALLOC_STRUCT(sccpOm5MinHistoryTable_data)) != NULL) {
				StorageTmp->sccpNetworkEntityId = curr->sccpNetworkEntityId;
				StorageTmp->sccpOmInterval = ++curr->sccpOmErrors5MinValidIntervals;
				sccpOm5MinHistoryTable_add(&StorageTmp);
			}
		}
		for (hci5 = sccpOm5MinHistoryTableStorage; hci5; hci5 = hci5->next) {
			struct sccpOm5MinHistoryTable_data *hist5 = (typeof(hist5)) hci5->data;

			if (hist5->sccpNetworkEntityId != curr->sccpNetworkEntityId)
				continue;
			if (hist5->sccpOmInterval != curr->sccpOmErrors5MinValidIntervals)
				continue;
			break;
		}
		for (; hci5; hci5 = hci5->prev) {
			struct sccpOm5MinHistoryTable_data last = (typeof(last)) hci5->data;

			if (last->sccpNewtorkEntityId != curr->sccpNetworkEntityId)
				continue;
			if (last->sccpOmInterval == 1) {
				/* complete the rotation */
				last->sccpOm5MinNoTranslatorForAddress = curr->sccpOmNoTranslatorForAddress;
				last->sccpOm5MinNoRuleForAddress = curr->sccpOmNoRuleForAddress;
				last->sccpOm5MinPointCodeNotAvailable = curr->sccpOmPointCodeNotAvailable;
				last->sccpOm5MinPointCodeCongested = curr->sccpOmPointCodeCongested;
				last->sccpOm5MinSubsystemUnavailable = curr->sccpOmSubsystemUnavailable;
				last->sccpOm5MinSubsystemCongested = curr->sccpOmSubsystemCongested;
				last->sccpOm5MinUnequippedSubsystem = curr->sccpOmUnequippedSubsystem;
				last->sccpOm5MinSyntaxErrorDetected = curr->sccpOmSyntaxErrorDetected;
				last->sccpOm5MinRoutingFailure = curr->sccpOmRoutingFailure;
				last->sccpOm5MinReassemblyTimeOut = curr->sccpOmReassemblyTimeOut;
				last->sccpOm5MinSegmentOutOfOrder = curr->sccpOmSegmentOutOfOrder;
				last->sccpOm5MinNoReassemblySpace = curr->sccpOmNoReassemblySpace;
				last->sccpOm5MinHopCounterViolation = curr->sccpOmHopCounterViolation;
				last->sccpOm5MinTooLargeForSegmentation = curr->sccpOmTooLargeForSegmentation;
				last->sccpOm5MinReleaseFailure = curr->sccpOmReleaseFailure;
				last->sccpOm5MinInactivityTimerExpiry = curr->sccpOmInactivityTimerExpiry;
				last->sccpOm5MinProviderInitiatedReset = curr->sccpOmProviderInitiatedReset;
				last->sccpOm5MinProviderInitiatedRelease = curr->sccpOmProviderInitiatedRelease;
				last->sccpOm5MinNoSegmentationSupport = curr->sccpOmNoSegmentationSupport;
				last->sccpOm5MinSegmentationFailure = curr->sccpOmSegmentationFailure;
				last->sccpOm5MinReassemblyFailure = curr->sccpOmReassemblyFailure;
				last->sccpOm5MinTotalMessagesHandled = curr->sccpOmTotalMessagesHandled;
				last->sccpOm5MinTotalMessagesLocal = curr->sccpOmTotalMessagesLocal;
				last->sccpOm5MinTotalMessagesGTT = curr->sccpOmTotalMessagesGTT;
				last->sccpOm5MinUDTMessagesSent = curr->sccpOmUDTMessagesSent;
				last->sccpOm5MinUDTSMessagesSent = curr->sccpOmUDTSMessagesSent;
				last->sccpOm5MinUDTMessagesReceived = curr->sccpOmUDTMessagesReceived;
				last->sccpOm5MinUDTSMessagesReceived = curr->sccpOmUDTSMessagesReceived;
				last->sccpOm5MinCRMessagesSent = curr->sccpOmCRMessagesSent;
				last->sccpOm5MinCREFMessagesSent = curr->sccpOmCREFMessagesSent;
				last->sccpOm5MinCRMessagesReceived = curr->sccpOmCRMessagesReceived;
				last->sccpOm5MinCREFMessagesReceived = curr->sccpOmCREFMessagesReceived;
				last->sccpOm5MinRSRMessagesSent = curr->sccpOmRSRMessagesSent;
				last->sccpOm5MinRSRMessagesReceived = curr->sccpOmRSRMessagesReceived;
				last->sccpOm5MinERRMessagesSent = curr->sccpOmERRMessagesSent;
				last->sccpOm5MinERRMessagesReceived = curr->sccpOmERRMessagesReceived;
				last->sccpOm5MinXUDTMessagesSent = curr->sccpOmXUDTMessagesSent;
				last->sccpOm5MinXUDTSMessagesSent = curr->sccpOmXUDTSMessagesSent;
				last->sccpOm5MinXUDTMessagesReceived = curr->sccpOmXUDTMessagesReceived;
				last->sccpOm5MinXUDTSMessagesReceived = curr->sccpOmXUDTSMessagesReceived;
				last->sccpOm5MinLUDTMessagesSent = curr->sccpOmLUDTMessagesSent;
				last->sccpOm5MinLUDTSMessagesSent = curr->sccpOmLUDTSMessagesSent;
				last->sccpOm5MinLUDTMessagesReceived = curr->sccpOmLUDTMessagesReceived;
				last->sccpOm5MinLUDTSMessagesReceived = curr->sccpOmLUDTSMessagesReceived;
				last->sccpOm5MinSSCMessageReceived = curr->sccpOmSSCMessageReceived;
				last->sccpOm5MinSSPMessageReceived = curr->sccpOmSSPMessageReceived;
			} else {
				struct sccpOm15MinHistoryTable_data prev = (typeof(prev)) hci5->prev->data;

				/* rotate the data */
				last->sccpOm5MinNoTranslatorForAddress = prev->sccpOm5MinNoTranslatorForAddress;
				last->sccpOm5MinNoRuleForAddress = prev->sccpOm5MinNoRuleForAddress;
				last->sccpOm5MinPointCodeNotAvailable = prev->sccpOm5MinPointCodeNotAvailable;
				last->sccpOm5MinPointCodeCongested = prev->sccpOm5MinPointCodeCongested;
				last->sccpOm5MinSubsystemUnavailable = prev->sccpOm5MinSubsystemUnavailable;
				last->sccpOm5MinSubsystemCongested = prev->sccpOm5MinSubsystemCongested;
				last->sccpOm5MinUnequippedSubsystem = prev->sccpOm5MinUnequippedSubsystem;
				last->sccpOm5MinSyntaxErrorDetected = prev->sccpOm5MinSyntaxErrorDetected;
				last->sccpOm5MinRoutingFailure = prev->sccpOm5MinRoutingFailure;
				last->sccpOm5MinReassemblyTimeOut = prev->sccpOm5MinReassemblyTimeOut;
				last->sccpOm5MinSegmentOutOfOrder = prev->sccpOm5MinSegmentOutOfOrder;
				last->sccpOm5MinNoReassemblySpace = prev->sccpOm5MinNoReassemblySpace;
				last->sccpOm5MinHopCounterViolation = prev->sccpOm5MinHopCounterViolation;
				last->sccpOm5MinTooLargeForSegmentation = prev->sccpOm5MinTooLargeForSegmentation;
				last->sccpOm5MinReleaseFailure = prev->sccpOm5MinReleaseFailure;
				last->sccpOm5MinInactivityTimerExpiry = prev->sccpOm5MinInactivityTimerExpiry;
				last->sccpOm5MinProviderInitiatedReset = prev->sccpOm5MinProviderInitiatedReset;
				last->sccpOm5MinProviderInitiatedRelease = prev->sccpOm5MinProviderInitiatedRelease;
				last->sccpOm5MinNoSegmentationSupport = prev->sccpOm5MinNoSegmentationSupport;
				last->sccpOm5MinSegmentationFailure = prev->sccpOm5MinSegmentationFailure;
				last->sccpOm5MinReassemblyFailure = prev->sccpOm5MinReassemblyFailure;
				last->sccpOm5MinTotalMessagesHandled = prev->sccpOm5MinTotalMessagesHandled;
				last->sccpOm5MinTotalMessagesLocal = prev->sccpOm5MinTotalMessagesLocal;
				last->sccpOm5MinTotalMessagesGTT = prev->sccpOm5MinTotalMessagesGTT;
				last->sccpOm5MinUDTMessagesSent = prev->sccpOm5MinUDTMessagesSent;
				last->sccpOm5MinUDTSMessagesSent = prev->sccpOm5MinUDTSMessagesSent;
				last->sccpOm5MinUDTMessagesReceived = prev->sccpOm5MinUDTMessagesReceived;
				last->sccpOm5MinUDTSMessagesReceived = prev->sccpOm5MinUDTSMessagesReceived;
				last->sccpOm5MinCRMessagesSent = prev->sccpOm5MinCRMessagesSent;
				last->sccpOm5MinCREFMessagesSent = prev->sccpOm5MinCREFMessagesSent;
				last->sccpOm5MinCRMessagesReceived = prev->sccpOm5MinCRMessagesReceived;
				last->sccpOm5MinCREFMessagesReceived = prev->sccpOm5MinCREFMessagesReceived;
				last->sccpOm5MinRSRMessagesSent = prev->sccpOm5MinRSRMessagesSent;
				last->sccpOm5MinRSRMessagesReceived = prev->sccpOm5MinRSRMessagesReceived;
				last->sccpOm5MinERRMessagesSent = prev->sccpOm5MinERRMessagesSent;
				last->sccpOm5MinERRMessagesReceived = prev->sccpOm5MinERRMessagesReceived;
				last->sccpOm5MinXUDTMessagesSent = prev->sccpOm5MinXUDTMessagesSent;
				last->sccpOm5MinXUDTSMessagesSent = prev->sccpOm5MinXUDTSMessagesSent;
				last->sccpOm5MinXUDTMessagesReceived = prev->sccpOm5MinXUDTMessagesReceived;
				last->sccpOm5MinXUDTSMessagesReceived = prev->sccpOm5MinXUDTSMessagesReceived;
				last->sccpOm5MinLUDTMessagesSent = prev->sccpOm5MinLUDTMessagesSent;
				last->sccpOm5MinLUDTSMessagesSent = prev->sccpOm5MinLUDTSMessagesSent;
				last->sccpOm5MinLUDTMessagesReceived = prev->sccpOm5MinLUDTMessagesReceived;
				last->sccpOm5MinLUDTSMessagesReceived = prev->sccpOm5MinLUDTSMessagesReceived;
				last->sccpOm5MinSSCMessageReceived = prev->sccpOm5MinSSCMessageReceived;
				last->sccpOm5MinSSPMessageReceived = prev->sccpOm5MinSSPMessageReceived;
			}
		}
		if (curr->sccpOmErrors5MinValidIntervals % 3 == 0) {
			/* every 3rd 5-minute interval rotate 15-minute data too */
			if (curr->sccpOmErrors15MinValidIntervals < sccpOmMIBStorage->sccpOm15MinMaxIntervals) {
				struct sccpOm15MinHistoryTable_data *StorageTmp;

				if ((StorageTmp = SNMP_MALLOC_STRUCT(sccpOm5MinHistoryTable_data)) != NULL) {
					StorageTmp->sccpNetworkEntityId = curr->sccpNetworkEntityId;
					StorageTmp->sccpOmInterval = ++curr->sccpOmErrors15MinValidIntervals;
					sccpOm15MinHistoryTable_add(&StorageTmp);
				}
			}
			for (hci15 = sccpOm15MinHistoryTableStorage; hci15; hci15 = hci15->next) {
				struct sccpOm15MinHistoryTable_data *hist15 = (typeof(hist15)) hci15->data;

				if (hist15->sccpNetworkEntityId != curr->sccpNetworkEntityId)
					continue;
				if (hist15->sccpOmInterval != curr->sccpOmErrors15MinValidIntervals)
					continue;
				break;
			}
		}
		if (hci15 != NULL) {
		}
	}
}

